import styled from "styled-components"

const CollectionPreview = styled.div`
    display: flex;
    flex-direction: column;
    .collection-container{
        display: grid;
        grid-template-columns: 1fr 1fr 1fr 1fr;
        grid-gap: 10px;
    }
`
export default CollectionPreview
